import Navop from './Navop';


function Nav (props)  {
const type = ["Home","Products","Contact Us","Cart"];
return(
    <div className="w-full fixed z-20 flex bg-black text-white mix-blend-screen justify-around ">

  {type.map((type)=>{return<Navop fn={props.fn} name={type}></Navop>}) }
  <input type="text" className=" my-2 rounded-full border-style:solid border-2 border-purple-800 text-black"></input>
    </div>
)
}

export default Nav;
